import '../styles/Navbar.css';
function Navbar1() {
  return (
    <>
      {/* Give navbar for hostel app */}
      <nav className="navbar navbar-brand nav">
        <h1>Hostel App</h1>
        <div className="links">
          <a href="/">Home</a>
          <a href="/create">New Hostel</a>
        </div>
      </nav>
    </>
  );
}

export default Navbar1;
